/**
 * Reads previously authorized credentials from the save file.
 *
 * @return {Promise<OAuth2Client|null>}
 * 
 * */


export async function envJSON(data:any){

const SCOPES = ['https://www.googleapis.com/auth/calendar'];
const TOKEN_PATH = path.join(process.cwd(), 'token.json');
const CREDENTIALS_PATH = path.join(process.cwd(), 'credentials.json');

    async function loadSavedCredentialsIfExist() {
        try {
            let content:any
         fs.readFile(TOKEN_PATH, 'utf-8', (err, data2) => {
            if (err) {
              console.error('Error reading file:', err);
              return;
            }
            content = data2
            console.log('File content:', data2);
          });
          const credentials = JSON.parse(content);
          return google.auth.fromJSON(credentials);
        } catch (err) {
          return null;
        }
      }

      /**
       * Serializes credentials to a file compatible with GoogleAUth.fromJSON.
       *
       * @param {OAuth2Client} client
       * @return {Promise<void>}
       */
      async function saveCredentials(client:any): Promise<void> {
        let content:any
       content = fs.readFile(CREDENTIALS_PATH, 'utf-8', (err, data3) => {
           if (err) {
             console.error('Error reading file:', err);
             return;
           }
           content = data3
         console.log('File content:', content);
        const keys = JSON.parse(content);
        const key = keys.installed || keys.web;
        const payload = JSON.stringify({
          type: 'authorized_user',
          client_id: key.client_id,
          client_secret: key.client_secret,
          refresh_token: client.credentials.refresh_token,
        });
        fs.writeFile(TOKEN_PATH, payload, 'utf-8', (err) => {
            if (err) {
              console.error('Error writing to file:', err);
              return;
            }


            console.log('File written successfully.');
            return;
          });
      })
    }
      /**
       * Load or request or authorization to call APIs.
       *
       */
      async function authorize() {
        let client: any = await loadSavedCredentialsIfExist();
        if (client) {
          return client;
        }
        client = await authenticate({
          scopes: SCOPES,
          keyfilePath: CREDENTIALS_PATH,
        });
        if (client.credentials) {
          await saveCredentials(client);
        }
        return client;
      }

      /**
       * Lists the next 10 events on the user's primary calendar.
       * @param {google.auth.OAuth2} auth An authorized OAuth2 client.
       */
      async function listEvents(auth:any) {
        const calendar = google.calendar({version: 'v3', auth});
         await calendar.events.insert({
            calendarId: 'primary',
            requestBody: data,
        }, function (err:any, event: any) {
            if (err) {
                console.log('There was an error contacting the Calendar service: ' + err);
                return;
            }
            console.log('Event created: %s', event);
        })
      };
        authorize().then(listEvents).catch(console.error);

}

