interface imovel {
  nome: string,
  codigo: string,
  url: string,
  bairro: string,
  cidade: string,
  preco: string,
  change: string,
  descriptionMain: any,
  descriptionOthers: any,
}

interface Page {
  url: string;
  text: string;
  title: string;
  codigo: string;
}


class WebCrawler {
  pages: Page[];

  limit: number;

  urls: string[];

  count: number;

  textLengthMinimum: number;

  selector: string;

  crawler: Crawler;

  constructor(
    urls: string[],
    selector = 'body',
    limit = 20,
    textLengthMinimum = 200
  ) {
    this.urls = urls;
    this.selector = selector;
    this.limit = limit;
    this.textLengthMinimum = textLengthMinimum;
    this.count = 0;
    this.pages = [];
    this.crawler = new Crawler({
      maxConnections: 10,
      callback: this.handleRequest,
      userAgent: 'node-crawler',
    });
  }


  handleRequest = (error: Error | null, res: CrawlerRequestResponse, done: () => void) => {
    if (error) {
      stderr.write(error.message);
      done();
      return;
    }

    const $ = cheerio.load(res.body);
    // Remove obviously superfluous elements
    $('script').remove();
    $('header').remove();
    $('nav').remove();
    $('style').remove();
    $('img').remove();
    $('svg').remove();
    $('span').remove();
    $('footer').remove();
    $('nav').remove();


    const title = $('title').text() || '';
    const text = $(this.selector).text();
    const codigo = $('p.PropertyDetails_propertyInfoAddress___r2XR').text()
    // const text = turndownService.turndown(html || '');

    const page: Page = {
      url: res.request.uri.href,
      text,
      title,
      codigo,
    };
    if (text.length > this.textLengthMinimum) {
      this.pages.push(page);
    }

    $('a').each((_i: number, elem: cheerio.Element) => {
      if (this.count >= this.limit) {
        return false; // Stop iterating once the limit is reached
      }

      const href = $(elem).attr('href')?.split('#')[0];
      const uri = res.request.uri.href;
      const url = href && resolve(uri, href);
      // crawl more
      if (url && this.urls.some((u) => url.includes(u))) {
        this.crawler.queue(url,);
        this.count += 1;
      }
      return true; // Continue iterating when the limit is not reached
    });

    done();
  };

  start = async () => {
    this.pages = [];
    return new Promise((resolve) => {
      this.crawler.on('drain', () => {
        resolve(this.pages);
      });
      this.urls.forEach((url) => {
        this.crawler.queue(url);
      });
    });
  };
}

